import React from "react";
import './App.css';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

import Sidebar from "./components/Sidebar/Sidebar";


function App() {

  return (


    <div className="App">
      <div className="AppGlass">

        <Router>
          <Sidebar/>
          <Switch>
            <Route path ='/' />
          </Switch>
        </Router>

        <div></div>
        <div></div>
        <div></div>

      </div>
    </div>
  );
}

export default App;
